import React from 'react';
import ReactDOM from 'react-dom';

const fname = "Zobayada";
const lname = "Afnan";
console.log( `My first name is ${fname} & My last name is ${lname}`);

const date = new Date().toLocaleDateString();
const times = new Date().toLocaleTimeString();

ReactDOM.render(
    <>
        <h1>{`My first name is ${fname} & My last name is ${lname}`}</h1>
        <h1>Top 3 fav Movie</h1>
        <p>Here are: </p>
        <ol>
            <li> Master</li>
            <li> Taqdeer</li>
            <li> Dj</li>
        </ol>
        <p>Today date is: {date}</p>
        <p>Current time is: {times}</p>

    </>,
    document.getElementById('root')
);
